import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Table } from "react-bootstrap";
import Footer from "./Footer";
import { Link } from "react-router-dom";
import AdminNavbar from "./AdminNab";
import { CDBSidebarContent, CDBSidebarHeader, CDBSidebarFooter, CDBSidebarMenu, CDBSidebarMenuItem, CDBSidebar} from 'cdbreact'; 
import {NavLink} from 'react-router-dom'; 
import {} from 'react-router-dom';

export default class WasherProfile extends Component {
  // Start
  // Constructor
  constructor(props) {
    super(props);

    this.state = {
      items: [],
      DataisLoaded: false,
    };
  }

  // ComponentDidMount is used to
  // execute the code
  componentDidMount() {
    fetch("http://localhost:9094/washer/allwasher")
      .then((res) => res.json())
      .then((json) => {
        this.setState({
          items: json,
          DataisLoaded: true,
        });
      });
  }
  //End

  render() {
    const { DataisLoaded, items } = this.state;

    return (
      <>
       <AdminNavbar />



           <div className="row">
           <div className='col-md-3'>
           <div className='h '  style={{ height:'100%', overflow:'scroll initial'}}>
               <CDBSidebar textColer="#fff" backgroundColor="rgb(37, 90, 122)">
                   <CDBSidebarHeader prefix={<i className="fa fa-bars fa-large"></i>}>
                       <Link to="/dashboard">Dashboard</Link>
                   </CDBSidebarHeader>
                   <CDBSidebarContent className="sidebar-content">
                       <CDBSidebarMenu>
                           <NavLink exact to="/profile" activeClassName="activeClicked">
                               <CDBSidebarMenuItem icon="columns">
                                   User Profiles
                               </CDBSidebarMenuItem>
                           </NavLink>
                           {/* <NavLink exact to="/WasherProfile" activeClassName="activeClicked">
                               <CDBSidebarMenuItem icon="columns">
                                   Washer Profiles
                               </CDBSidebarMenuItem>
                           </NavLink>
                           <NavLink exact to="/dashboard" activeClassName="activeClicked">
                               <CDBSidebarMenuItem icon="columns">
                                   Transfer
                               </CDBSidebarMenuItem>
                           </NavLink>
                           <NavLink exact to="/dashboard" activeClassName="activeClicked">
                                <CDBSidebarMenuItem icon="columns">
                                   Transfer
                               </CDBSidebarMenuItem>
                           </NavLink> */}
                            {/* <NavLink exact to="/WasherProfile" activeClassName="activeClicked"> */}
                            <CDBSidebarMenuItem icon="columns">
                               <Link to="/WasherProfile">Washer Profiles</Link>
                                   {/* Washer Profiles */}
                               </CDBSidebarMenuItem>
                           {/* </NavLink> */}
                           {/* <NavLink exact to="/orderdetails" activeClassName="activeClicked"> */}
                               <CDBSidebarMenuItem icon="columns">
                               <Link to="/orderdetails">Orders</Link>
                                   {/* Orders */}
                               </CDBSidebarMenuItem>
                           {/* </NavLink> */}
                           {/* <NavLink exact to="/addpacks" activeClassName="activeClicked"> */}
                                <CDBSidebarMenuItem icon="columns">
                                <Link to="/addpacks">Add Washpacks</Link>
                                   {/* Add Washpacks */}
                               </CDBSidebarMenuItem>
                           {/* </NavLink> */}
                       </CDBSidebarMenu>
                   </CDBSidebarContent>
                   <CDBSidebarFooter style={{textAlign:'center'}}>
                       <div className="sidebar-btn-wrapper" style={{ padding :'20px 5px' }}>
                           sidebar footer
                       </div>
                   </CDBSidebarFooter>
               </CDBSidebar>
           </div>

           </div>


<div className="text-centre">
          <h3 style={{marginLeft:"550px"}}>
            Washer Profiles
          </h3>


        </div>
        {items.map((item) => (
          <div className="container">
            <div className="row ">
              <div className="card" style={{width:"250px",marginBottom:"40px"}}>
                <div className="card-header text-centre">
                <label><b>{item.id}</b></label>


                </div>
                <div className="card-body"  >
                <label>Id: {item.id}</label><br/>
                <label>Name: {item.name}</label><br/>
                <label>Location: {item.location}</label><br/>
                <td><Link to ={`/Washer/${item.id}`}className="btn btn-outline-info">Delete Washer</Link></td>



                </div>

              </div>



            </div>



          </div>


        ))}

        <div>
          <Footer />
        </div>
        </div>
      </>
    );
  }
}
